window.bookSummaryJSON = "<p>Benjamin Bennett leads a lifestyle that many could only dream of. He's a star quarterback, well educated, and he knows how to get what he wants. But what he stays clear from is love because his ambition and goals don't align with it. </p> <p>Riana is sassy and all about herself. Her world consists of her career as a musician and she doesn't see anything outside of it. Though her intentions are good, she battles issues from the past that hinders her from truly moving forward in life, especially in the love department. </p> <p>Benji and Riana think they have things figured out until heartbreak shatters each of them leaving no choice but to rebuild themselves. But will they rebuild together? </p> <p>One important thing they learn is no matter how much money you have or how many people wish for your life, some things can't be avoided. </p> <p>Is it possible for them to move forward in a relationship or is it best to focus on themselves? Are the circumstances they're being forced to confront too overwhelming to work through? Most importantly, will Benji and Riana be able to fight against an unjust love?</p>"; 
